import './hardcoreCalendar.css';
import { HARDCORE_DETAILS } from '../../const.js'

function HardcoreCalendar () {
    return (
        <div>
          {HARDCORE_DETAILS.map((classInfo) => {
              return (
                <div className='container-cc py-1 flex'>
                  <div className='column centercenter'>
                    <h2 className='classTitle'>{classInfo.topicTitle}</h2>
                    <div className='optionalTitle'>
                        <div className='optionalDate1'>{classInfo.topicTitle_date1}</div>
                        <div className='liveTopicdate1'>{classInfo.topicTitle_title1}</div>
                    </div>
                    <div id='liveTopicTitle'>
                        <div className='optionalDate2'>{classInfo.topicTitle_date2}</div>
                        <div className='liveTopicdate2'>{classInfo.topicTitle_title2}</div>
                    </div>
                  </div>
                  <div className=''>

                    <p>{classInfo.desc}</p>
                  </div>
                </div>
              );
            })}
        </div>
    )
}


export default HardcoreCalendar;
